    false,nt"url": null,nt"notes": "Herring spawning and other data were collected
    from aircraft from Bristol Bay and other locations as part of the Outer Continental
    Shelf Environmental Assessment Program (OCSEAP). Data were collected from 12 April
    1976 to 12 July 1976 by the Alaska State Department of Fish and Game - Kodiak. Data
    were processed by NODC to the NODC standard F057 Herring Spawning format. Full format
    descriptions is available from the NODC homepage at www.nodc.noaa.gov/. An analog
    file for this accession is available from NODC user services.nnThe F057 format contains
    data from aircraft surveys of herring schools. These data were collected to provide
    information on herring population density and distribution. Start date and time,
    start and end positions, and aircraft type, altitude and airspeed were reported
    for each survey. Surveys were conducted for preassigned areas; mid-point positions
    of census areas were reported. environmental information may include meteorological
    conditions, sea state, air roughness and water clarity. Census data include species
    identification, school position and activity, school size index and number of schools
    sighted. Predominant beach type, biota type and escarpment type may also be indicated.",nt"owner_org":
